import React, { useState } from 'react';
import axios from 'axios';
import './assets/registroParticipantes.css';

const RegistrationForm = () => {




  const [nombreParticipante, setNombreParticipante] = useState('Jonatan');
  const [apellidoParticipante, setApellidoParticipante] = useState('Esprella');
  const [ciParticipante, setFechaFin] = useState('2023-10-20');
  const [modalidad, setModalidad] = useState('Persencial');
  const [participacion, setParticipacion] = useState('2');

  
  const [modalVisible, setModalVisible] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      await axios.post('http://localhost:8000/api/evento', {
        tituloEvento: nombreParticipante,
        fechaInicioEvento: apellidoParticipante
        
      });
      console.log('Evento creado con éxito');
      setModalVisible(true);
    } catch (error) {
   
      if (error.response) {
        
        console.error('Respuesta del servidor con error:', error.response);
        console.error('Código de estado HTTP:', error.response.status);
      } else if (error.request) {
        console.error('No se recibió respuesta del servidor:', error.request);
      } else {
        console.error('Error durante la configuración de la solicitud:', error.message);
      }
      setModalVisible(false);
    }
  };
};

export default RegistrationForm;
